import { useNavigate } from 'react-router-dom';


export const Main = () => {   
     const navigate = useNavigate();
    return (
        <div> 
            <div>Hello</div>
            <button onClick={<Navigate to="/sum" />}> clickM  </button>
        </div>
    );
}
